              <Image
                      src={require('./../../assets/images/Press (2).jpg')}
                      alt="Features tile icon 05"
                      width={1500}
                      height={1500} />&nbsp;
                <div className="testimonial-item-content">
                  <h6 className="text-sm mb-0">
